properties.Jolt Specification:
[
  {
    "operation": "cardinality",
    "spec": {
      "data": {
        "*": {
          "manifests": "MANY",
          "*": {
            "iews": "MANY",
            "*": {
              "invoices": "MANY",
              "*": {
                "invoice_details": "MANY"
              }
            }
          }
        }
      }
    }
  },
  {
    "operation": "modify-overwrite-beta",
    "spec": {
      "data": {
        "*": {
          "manifests": {
            "*": {
              "iews": {
                "*": {
                  "invoices": {
                    "*": {
                      "invoice_details": {
                        "*": {
                          "quantity": "=toInteger",
                          "price": "=toDouble",
                          "netto": "=toDouble",
                          "brutto": "=toDouble",
                          "setQuantity": 1,
                          "totalQuantity": "=toInteger(@(1,quantity))"
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
  },
  {
    "operation": "shift",
    "spec": {
      "data": {
        "*": {
          "location": "location",
          "manifests": {
            "*": {
              "iews": {
                "*": {
                  "invoices": {
                    "*": {
                      "invoice_details": {
                        "*": {
                          // кладемо всі поля одного елемента у items[&1]{...}
                          "title": "centralizing.@(1,code).items[&7][&5][&3][&1].title",
                          "quantity": "centralizing.@(1,code).items[&7][&5][&3][&1].quantity",
                          "setQuantity": "centralizing.@(1,code).items[&7][&5][&3][&1].setQuantity",
                          "totalQuantity": "centralizing.@(1,code).items[&7][&5][&3][&1].totalQuantity",
                          "price": "centralizing.@(1,code).items[&7][&5][&3][&1].price",
                          "brutto": "centralizing.@(1,code).items[&7][&5][&3][&1].brutto",
                          "netto": "centralizing.@(1,code).items[&7][&5][&3][&1].netto",
                          // code на рівні групи (повториться — стиснемо нижче до ONE)
                          "code": "centralizing.@(1,code).code"
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
  },
  {
    "operation": "cardinality",
    "spec": {
      // зробити code одиничним значенням (не масивом)
      "centralizing": {
        "*": {
          "code": "ONE"
        }
      }
    }
  },
  {
    "operation": "shift",
    "spec": {
      // перетворюємо мапу centralizing{code->{...}} на масив
      "centralizing": {
        "*": {
          "@": "centralizing[]"
        }
      },
      "location": "location"
    }
  },
  {
    "operation": "modify-default-beta",
    "spec": {
      // заповни за потреби константами
      "termsKey": "CPT",
      "currency": "EUR",
      "collectDate": "${now():format("dd.MM.yyyy")}",
      "atomCollectDate": "${now():format("yyyy-MM-dd'T'HH:mm:ss")}"
    }
  },
  {
    "operation": "shift",
    "spec": {
      "centralizing": {
        "*": {
          "items": {
            "*": {
              "*": {
                "*": {
                  "*": "centralizing[&5].items[]"
                }
              }
            }
          },
          "code": "centralizing[&1].code"
        }
      },
      "*": {
        "@": "&"
      }
    }
  },
  {
    "operation": "modify-overwrite-beta",
    "spec": {
      "centralizing": "=recursivelySquashNulls"
    }
  }
]

